import React, { Component } from "react";
import "./Search.css";
import Icons from "../../components/UI/Icons/Icons";
export default class extends Component {
  render() {
    return (
      <div className="Search">
        <div className="search-icon">
          <Icons type="search" />
        </div>
        <input placeholder="Search for anything" />
      </div>
    );
  }
}
